import React from 'react'


class Category extends React.Component {


    state = {
        category: "All"
    }


    render() {
        return <div className="categories">{this.props.categories.map(category => {
            return <button id={category} onClick={this.clickHandler}>{category}</button>
        })}
        </div>

    } 


}

export default Category
